import React, { useEffect } from 'react';
import './ProductsShowcase.css';

const ProductsShowcase = () => {
  useEffect(() => {
    const elements = Array.from(document.querySelectorAll('.reveal'));
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            entry.target.classList.add('is-visible');
            observer.unobserve(entry.target);
          }
        });
      },
      { threshold: 0.15, rootMargin: '0px 0px -10% 0px' }
    );
    elements.forEach((el) => observer.observe(el));
    return () => observer.disconnect();
  }, []);
  return (
    <section className="guaybo-section">
      <div className="strategy-banner">
        <span>NO ES SOLO DISEÑO, ES ESTRATEGIA QUE <b className="accent">EDUCA</b>,</span>
        <span className="accent-line"> CONECTA Y VENDE</span>
      </div>
      <div className="guaybo-container">

        <h2 className="guaybo-title">
          APRENDE CON <span className="brand">YARIFE X GUAYBO</span>
        </h2>

        <p className="guaybo-sub">
          LIBERA TU POTENCIAL <span className="accent">CREATIVO</span> CON MI
          <span className="underline"> CURSO COMPLETO </span>
          Y <span className="underline">EBOOK</span> PARA LLEVAR TUS PRESENTACIONES A OTRO NIVEL
        </p>

        <div className="guaybo-grid">
          {/* Card Curso */}
          <div className="guaybo-card course reveal">
            <div className="media media-course" aria-hidden="true"></div>
            <h3 className="card-title">Crea una presentación con Canva desde cero</h3>
            <div className="card-meta">
              <div>
                <div className="meta-title">Características:</div>
                <ul className="meta-list">
                  <li>Aprende a diseñar desde la estructura</li>
                  <li>Elementos gráficos y mejores prácticas</li>
                </ul>
              </div>
              <div className="price">$7,00</div>
            </div>
            <div className="card-actions">
              <a
                className="cta yellow"
                target="_blank"
                rel="noreferrer"
                href="https://guaybo.com/yarifepower/crea-una-presentacion-con-canva-desde-cero-1"
              >
                Ver curso
              </a>
            </div>
          </div>

          {/* Card Ebook */}
          <div className="guaybo-card ebook reveal">
            <div className="media media-ebook" aria-hidden="true"></div>
            <h3 className="card-title">Aprende a diseñar presentaciones efectivas y atractivas</h3>
            <div className="card-meta">
              <div>
                <div className="meta-title">Características:</div>
                <ul className="meta-list">
                  <li>Contenido potente y didáctico</li>
                  <li>Diseño atractivo y profesional</li>
                </ul>
              </div>
              <div className="price">$12,00</div>
            </div>
            <div className="card-actions">
              <a
                className="cta purple"
                target="_blank"
                rel="noreferrer"
                href="https://guaybo.com/yarifepower/ebook-aprende-a-disenar-presentaciones-efectivas-y-atractivas"
              >
                Ver Ebook
              </a>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default ProductsShowcase;
